import "./App.css";
import Navbar from "./components/Navbar";
import Login from "./pages/Login/Login";
import CreateAccount from "./pages/CreateAccount/CreateAccount";
import ResetPassword from "./pages/ResetPassword/ResetPassword";
import Mask from "./components/Mask/index";
import Congratulations from "./pages/Congratulations/Congratulations";
import ResetPasswordConfrimed from "./pages/ResetPasswordConfirmed";
import ApplicationForm from "./pages/ApplicationForm/ApplicationForm";
import { Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Navbar />
      <Switch>
        {" "}
        <Route exact path="/login" component={Login} />
        <Route exact path="/reset" component={ResetPassword} />
        <Route exact path="/done" component={ResetPasswordConfrimed} />
        <Route exact path="/create" component={CreateAccount} />
        <Route exact path="/congrats" component={Congratulations} />
        <Route exact path="/apply" component={ApplicationForm} />
      </Switch>
    </div>
  );
}

export default App;
